INSERT INTO `bp_buenasPracticas` VALUES (1,1,'Contar con el permiso o autorización de la CONANP','Contar con el permiso o autorización de la CONANP',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,1,'Tener un plan de mejora continua que se aplica','Tener un plan de mejora continua que se aplica',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,1,'Contar con un documento de planeación actualizado','Contar con un documento de planeación actualizado',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,2,'Aplicar un protocolo de emergencia, seguridad y primeros auxilios','Aplicar un protocolo de emergencia, seguridad y primeros auxilios',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,2,'Aplicar y evaluar un plan de interpretación ambiental','Aplicar y evaluar un plan de interpretación ambiental',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,2,'Aplicar y evaluar un plan de educación ambiental','Aplicar y evaluar un plan de educación ambiental',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,2,'Asegurar la calidad de los servicios ofrecidos al turista','Asegurar la calidad de los servicios ofrecidos al turista',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,2,'Aplicar el registro, medición y control de turistas','Aplicar el registro, medición y control de turistas',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,2,'Construir u operar senderos interpretativos','Construir u operar senderos interpretativos','Los senderos tanto acuáticos como terrestres son rutas que permiten narrar una historia del sitio que es relevante para los visitantes y permite concentrar el impacto de los visitantes en un sitio, por ello, la erosión del suelo, la acumulación de desechos, la perturbación de la flora y fauna, suele ocurrir en estos sitios y es una buena práctica que los prestadores de servicios:\n<ul>\n<li>Diseñen los senderos siguiendo la narración de una historia.</li>\n<li>Lleven registros de la operación del sendero.</li>\n<li>Anticipen medidas de reversión de los impactos mediante un plan de mantenimiento.</li>\n</ul>','Un sendero permite de manera ordenada, segura y amena desplazarse en un área silvestre y descubrir aspectos de la historia natural y cultural del sitio que se visita\nUn sistema de senderos, permite planificar y extender tanto como sea posible la presencia en un sitio en función de diversos recorridos que dependen de la disponibilidad de tiempo de los visitantes, grados de dificultad, condiciones climáticas y otras consideraciones.','Los senderos concentran el impacto de los visitantes en ciertas áreas y permiten dosificar información sobre el sitio y presentarla de manera apropiada y con significado para los visitantes.\nPor otra parte, hacen posible el monitoreo del impacto ambiental de los visitantes y concentrar los esfuerzos de vigilancia y restauración.','Los senderos permiten que los visitantes:\nIncrementen las actividades que pueden realizar.\nGanen perspectiva del sitio que visitan.\nAccedan de a los puntos más importante del sitio que se visita.\nExtender la permanencia en el sitio.\nTodos estos beneficios incrementan el valor de la experiencia ofrecida y por lo tanto, ganar una posición en el mercado.','Existen senderos que son diseñados como una unidad de negocios, es decir que el sendero genera sus propios ingresos a través del cobro a sus visitantes',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'bp9_1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,3,'Establecer una cadena de impacto y beneficio social','Establecer una cadena de impacto y beneficio social',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,3,'Difundir un reglamento de visitantes','Difundir un reglamento de visitantes',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,3,'Difundir un código de ética de la empresa','Difundir un código de ética de la empresa',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,3,'Realizar y registrar acciones de prevención de incendios','Realizar y registrar acciones de prevención de incendios',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(14,3,'Realizar acciones de reforestación','Realizar acciones de reforestación',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,4,'Elaborar y evaluar un plan de uso eficiente del agua','Elaborar y evaluar un plan de uso eficiente del agua',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,4,'Realizar captación de agua de lluvia','Realizar captación de agua de lluvia',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,4,'Utilizar dispositivos ahorradores de agua','Utilizar dispositivos ahorradores de agua',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,4,'Tratar las aguas utilizadas','Tratar las aguas utilizadas',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,4,'Hacer re-uso de agua tratada','Hacer re-uso de agua tratada',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,5,'Establecer y 